import React from 'react'
import './Item.css'

const Item = (props) => {
  return (
    <div class='rounded-16 bg-white -dark-bg-dark-1 shadow-4 h-100 relative d-block rounded-8 px-20 py-20 border-light'>
        <img src={props.image} alt="" />
        <p>{props.name}</p>
        <div className="item-prices">
            ${props.coins}
        </div>
        <button>Purchase</button>
    </div>
  )
}

export default Item
